import React from 'react'
import './Popup.css'

function Popup(props) {
  return (props.trigger) ? (
    <div className='popup'>
        <div className='popupinner'>
          <button className='popupclosebutton' onClick={() => props.setTrigger(false)}>X</button>
        </div>
    </div>
  ) : "";
}

export default Popup
